window.bookSummaryJSON = "<p><b>For the first time, listen to all three books in the Cityscape Affair series in one collection. Performed by Andi Arndt.</b></p> <p>Olivia Germaine has already found love. Devoted wife, loyal friend, determined career woman - she’s created the life she always envisioned...until she locks eyes with a handsome stranger across a crowded room.&nbsp;</p> <p>David Dylan, alleged playboy and Chicago’s most eligible bachelor, awakens a passion in Olivia she buried long ago. He’ll do anything to prove to her that despite his playboy ways, he’s worth leaving behind the stable future her husband can offer her.&nbsp;</p> <p>But in order to accept a love she never thought possible, with a man who could be her soulmate, Olivia will have to let go of deeply rooted fears that could ruin everything.</p> <p><i>Everything</i> is what David wants to give her, and it’s what he demands in return. But even as an alpha male who always gets what he wants...this time, David may be fighting for something unattainable.&nbsp;</p> <p>The <i>Cityscape Affair</i> box set includes three full-length novels: <i>Come Undone</i>, <i>Come Alive</i>, and <i>Come Together</i>.</p>"; 
